{
   // dma->back_buffer = &Buffer2;
   // Black out screen initially
   newState();
   wait_vsync();
   // dma->back_buffer = &Buffer1;

   newState();
   wait_vsync();
}
void newState()
{
   Point c = {320 / 2, 240 / 2};
   switch (gameState)
   {
   case START:
      draw_image(c, start_screen, WIDTH, HEIGHT, WIDTH, HEIGHT);
      break;
   case SINGLE_PLAYER:
      for (int x = 0; x < WIDTH; x++)
      {
         for (int y = 0; y < HEIGHT; y++)
         {
            clear_pixel(x, y, BG);
         }
      }
      break;
   case TWO_PLAYER:
      for (int x = 0; x < WIDTH; x++)
      {
         for (int y = 0; y < HEIGHT; y++)
         {
            clear_pixel(x, y, BG);
         }
      }
      break;
   case END:
   default:
      break;
   }
}

void updateState()
{
   switch (gameState)
   {
   case START:
      savePixels = 0;
      if (btn_singlePlayer.redraw)
      {
         if (btn_singlePlayer.isHovered)
         {
            draw_image(
                btn_singlePlayer.loc,
                img_singlePlayer[1],
                btn_singlePlayer.width,
                btn_singlePlayer.height,
                btn_singlePlayer.width,
                btn_singlePlayer.height);
            btn_singlePlayer.redraw--;
         }
         else
         {
            draw_image(
                btn_singlePlayer.loc,
                img_singlePlayer[0],
                btn_singlePlayer.width,
                btn_singlePlayer.height,
                btn_singlePlayer.width,
                btn_singlePlayer.height);
            btn_singlePlayer.redraw--;
         }
      }

      if (
          mouse.position.x >= btn_singlePlayer.loc.x - btn_singlePlayer.width / 2 &&
          mouse.position.x <= btn_singlePlayer.loc.x + btn_singlePlayer.width / 2 &&
          mouse.position.y >= btn_singlePlayer.loc.y - btn_singlePlayer.height / 2 &&
          mouse.position.y <= btn_singlePlayer.loc.y + btn_singlePlayer.height / 2)
      {
         if (!btn_singlePlayer.isHovered)
         {
            btn_singlePlayer.isHovered = 1;
            btn_singlePlayer.redraw = 2;
         }
      }
      else if (btn_singlePlayer.isHovered)
      {
         btn_singlePlayer.isHovered = 0;
         btn_singlePlayer.redraw = 2;
      }

      if (btn_twoPlayer.redraw)
      {
         if (btn_twoPlayer.isHovered)
         {
            draw_image(
                btn_twoPlayer.loc,
                img_twoPlayer[1],
                btn_twoPlayer.width,
                btn_twoPlayer.height,
                btn_twoPlayer.width,
                btn_twoPlayer.height);
            btn_twoPlayer.redraw--;
         }
         else
         {
            draw_image(
                btn_twoPlayer.loc,
                img_twoPlayer[0],
                btn_twoPlayer.width,
                btn_twoPlayer.height,
                btn_twoPlayer.width,
                btn_twoPlayer.height);
            btn_twoPlayer.redraw--;
         }
      }

      if (
          mouse.position.x >= btn_twoPlayer.loc.x - btn_twoPlayer.width / 2 &&
          mouse.position.x <= btn_twoPlayer.loc.x + btn_twoPlayer.width / 2 &&
          mouse.position.y >= btn_twoPlayer.loc.y - btn_twoPlayer.height / 2 &&
          mouse.position.y <= btn_twoPlayer.loc.y + btn_twoPlayer.height / 2)
      {
         if (!btn_twoPlayer.isHovered)
         {
            btn_twoPlayer.isHovered = 1;
            btn_twoPlayer.redraw = 2;
         }

         if (mouse.wasLeft)
         {
            gameState = TWO_PLAYER;
            initState();
            return;
         }
      }
      else if (btn_twoPlayer.isHovered)
      {
         btn_twoPlayer.isHovered = 0;
         btn_twoPlayer.redraw = 2;
      }

      savePixels = 1;
      break;
   case TWO_PLAYER:
      // Clear buffer of old plot
      draw_cells();

      // Read mouse data
      if (mouse.left)
      {
         placePiece();
      }
   default:
      break;
   }
}

void draw_cells()
{
   for (int r = 0; r < 3; r++)
   {
      for (int c = 0; c < 3; c++)
      {
         struct cell *cell = &cells[r][c];
         short clr = 0xef3b;

         if (mouse.position.x > cell->offsetx &&
             mouse.position.x < cell->offsetx + cell->width &&
             mouse.position.y > cell->offsety &&
             mouse.position.y < cell->offsety + cell->height)
         {
            clr = cell->occupied != '-' ? 0xce37 : turn == 'x' ? 0xf470
                                                               : 0x7577; // 0xce37;

            if (cell->clr != clr)
            {
               cell->clr = clr;
               cell->redraw = 2;
            }
         }
         else if (cell->clr != clr)
         {
            cell->clr = clr;
            cell->redraw = 2;
         }

         if (cell->redraw)
         {
            savePixels = 0;
            draw_square(cell->center, cell->width, cell->height, clr);

            if (cell->occupied == 'x')
               draw_image(cell->center, piece_x, cell->pieceDrawX, cell->pieceDrawY, 40, 40);
            else if (cell->occupied == 'o')
               draw_image(cell->center, piece_o, cell->pieceDrawX, cell->pieceDrawY, 40, 40);
            savePixels = 1;

            if (cell->occupied != '-' && cell->pieceDrawX != 40 && cell->pieceDrawY != 40)
            {
               cell->redraw += 2;
               if (cell->fCount == 1)
               {
                  cell->pieceDrawX++;
                  cell->pieceDrawY++;
                  cell->fCount = 0;
               }
               else
               {
                  cell->fCount++;
               }
            }
         }
      }
   }

   for (int r = 0; r < 3; r++)
   {
      for (int c = 0; c < 3; c++)
      {
         struct cell *cell = &cells[r][c];

         if (cell->redraw)
         {
            savePixels = 0;
            Point points[4] = {
                {cell->offsetx, cell->offsety},
                {cell->offsetx + cell->width, cell->offsety},
                {cell->offsetx + cell->width, cell->offsety + cell->height},
                {cell->offsetx, cell->offsety + cell->height}};

            for (int i = 1; i <= 4; i++)
            {
               draw_line(points[(i - 1) % 4], points[i % 4], 0x0000);
            }
            cell->redraw--;
            savePixels = 1;
         }
      }
   }
}
void checkWinner()
{
   int x = mouse.position.x;
   int y = mouse.position.y;

   int c = (x - CELLS_X_START) / 50;
   int r = (y - CELLS_Y_START) / 50;

   int winner = 2;
   if (turn == 'x')
   {
      winner = 1;
   }

   // Check row or collumn
   if ((cells[r][(c + 1) % 3].occupied == turn && cells[r][(c + 2) % 3].occupied == turn) ||
       (cells[(r + 1) % 3][c].occupied == turn && cells[(r + 2) % 3][c].occupied == turn))
   {
      winnerState = winner;
      return;
   }

   // Check either diagonal
   if ((r == c && cells[(r + 1) % 3][(c + 1) % 3].occupied == turn && cells[(r + 2) % 3][(c + 2) % 3].occupied == turn) ||
       // checks top left to bottom right

       (r + c == 2 && cells[(r + 1) % 3][(c + 2) % 3].occupied == turn && cells[(r + 2) % 3][(c + 1) % 3].occupied == turn))
   // checks top right to bottom left
   {
      winnerState = winner;
      return;
   }

   // if no winner, check tie
   int isTie = 1;
   for (int i = 0; i < 3; i++)
   {
      for (int j = 0; j < 3; j++)
      {
         if (cells[i][j].occupied == '-')
         { // if any are empty, no tie
            isTie = 0;
            break;
         }
      }
      if (!isTie)
         break;
   }
   if (isTie)
      winnerState = tie;
}

void placePiece()
{
   int x = mouse.position.x;
   int y = mouse.position.y;

   if (x < CELLS_X_START || x > CELLS_X_END ||
       y < CELLS_Y_START || y > CELLS_Y_END)
      return;

   int c = (x - CELLS_X_START) / 50;
   int r = (y - CELLS_Y_START) / 50;

   if (cells[r][c].occupied != '-')
      return;

   cells[r][c].occupied = turn;
   cells[r][c].redraw = 2;

   checkWinner();
   if (turn == 'x')
      turn = 'o';
   else
      turn = 'x';
}

void draw_square(Point p, int width, int height, short clr)
{
   for (int x = p.x - width / 2; x <= p.x + width / 2; x++)
   {
      for (int y = p.y - height / 2; y <= p.y + height / 2; y++)
      {
         plot_pixel(x, y, clr);
      }
   }
}

void draw_circle(Point p, int r, short clr)
{
   for (int x = p.x - r; x <= p.x + r; x++)
   {
      for (int y = p.y - r; y <= p.y + r; y++)
      {
         if ((x - p.x) * (x - p.x) + (y - p.y) * (y - p.y) > r * r)
            continue;

         plot_pixel(x, y, clr);
      }
   }
}

void draw_image(Point p, short *image, int cx, int cy, int width, int height)
{
   for (int x = width / 2 - cx / 2; x < width / 2 + cx / 2; x++)
   {
      for (int y = height / 2 - cy / 2; y < height / 2 + cy / 2; y++)
      {
         int xpos = p.x + x - width / 2;
         int ypos = p.y + y - height / 2;

         short clr = image[y * width + x];

         // printf("%x\n", clr);
         if (clr == 0xffffabcd)
            continue;

         plot_pixel(xpos, ypos, clr);
      }
   }
}

void draw_line(Point p0, Point p1, int short clr)
{
   int x0 = p0.x;
   int y0 = p0.y;
   int x1 = p1.x;
   int y1 = p1.y;
   char isSteep = abs(y1 - y0) > abs(x1 - x0);

   if (isSteep)
   {
      swap(&x0, &y0);
      swap(&x1, &y1);
   }

   if (x0 > x1)
   {
      swap(&x0, &x1);
      swap(&y0, &y1);
   }

   int dx = x1 - x0;
   int dy = abs(y1 - y0);

   int err = -(dx / 2);

   int y = y0;

   int yStep = -1;
   if (y < y1)
      yStep = 1;

   for (int x = x0; x <= x1; x++)
   {
      if (isSteep)
         plot_pixel(y, x, clr);
      else
         plot_pixel(x, y, clr);

      err += dy;

      if (err > 0)
      {
         y += yStep;
         err = err - dx;
      }
   }
}

