void clear_screen()
{
   while (arrListOfPixels[buff].count)
   {
      // printf("clr: %x\n", arrListOfPixels[buff].head->clr);
      clear_pixel(arrListOfPixels[buff].head->x, arrListOfPixels[buff].head->y, arrListOfPixels[buff].head->clr);
      pop();
   }
}

void plot_pixel(int x, int y, short int clr)
{
   if (x < 0 || x >= WIDTH || y < 0 || y >= HEIGHT)
      return;

   unsigned int offset = (y << 10) + (x << 1);
   volatile short int *one_pixel_address =
       (short int *)((unsigned int)dma->back_buffer + offset);

   volatile unsigned short int *prev = (unsigned short int *)((unsigned int)dma->back_buffer + offset);
   Pixel p = {x, y, (short)*prev, NULL};
   /*if (buff == 1) {
      p.clr = Buffer2[x][y];
   } else {
      p.clr = Buffer1[x][y];
   }*/

   *one_pixel_address = clr;

   if (savePixels)
   {
      // printf("%d %x\n", buff, p.clr);
      push(p);
   }
}

void clear_pixel(int x, int y, short int clr)
{
   if (x < 0 || x >= WIDTH || y < 0 || y >= HEIGHT)
      return;

   unsigned int offset = (y << 10) + (x << 1);
   volatile short int *one_pixel_address =
       (short int *)((unsigned int)dma->back_buffer + offset);

   *one_pixel_address = clr;
}

void wait_vsync()
{
   dma->front_buffer = 1;

   // printf("Before\n");
   while (dma->status & 0x1)
   {
      // printf("Status %x\n", dma->status);
   }
}

void pop()
{

   // Decrement counter
   arrListOfPixels[buff].count--;

   // Advance head
   Pixel *next = arrListOfPixels[buff].head->next;

   // Free memory
   free(arrListOfPixels[buff].head);

   arrListOfPixels[buff].head = next;
}

void push(Pixel p)
{
   // Allocate memory for new items
   Pixel *newP = (Pixel *)malloc(sizeof(Pixel));
   newP->x = p.x;
   newP->y = p.y;
   newP->clr = p.clr;
   newP->next = NULL;

   if (arrListOfPixels[buff].count == 0)
   { // empty
      arrListOfPixels[buff].head = arrListOfPixels[buff].tail = newP;
   }
   else
   {
      // Add item to tail
      arrListOfPixels[buff].tail->next = newP;
      arrListOfPixels[buff].tail = newP;
   }

   arrListOfPixels[buff].count++;
}

void initMouse()
{
   // Reset mouse
   ps2->data = 0xff;

   // Initialize mouse
   char byte1 = 0;
   char byte2 = 0;
   char byte3 = 0;

   int mouse_data;
   int rvalid;

   while (1)
   {
      mouse_data = ps2->data;
      rvalid = mouse_data & 0x8000;

      // printf("%x\n", mouse_data);
      if (rvalid)
      {
         byte1 = byte2;
         byte2 = byte3;
         byte3 = mouse_data & 0xff;

         // printf("%x, %x, %x\n", byte3, byte2, byte1);

         if (byte3 == (char)0xAA)
         { // && byte3 == (char)0x00){// && (byte3 == (char)0x00)){// && byte3 == (char)0x00) {
            ps2->data = 0xf4;
            byte3 = ps2->data;
            return;
         }
      }
   }
}

int processMouse()
{
   int packetsRecieved = 0;
   int data = ps2->data;

   if (!(data & 0x8000) || (char)(data & 0xff) == (char)0xfa)
      return 0;

   char byte1 = 0, byte2 = 0, byte3 = 0;

   do
   {
      packetsRecieved++;
      byte1 = byte2;
      byte2 = byte3;
      byte3 = data & 0xff;

      if (packetsRecieved == 3)
         break;

      data = ps2->data;

      // printf("%x, %d\n", data, packetsRecieved);

      while (!(data & 0x8000))
         data = ps2->data;

   } while (1);

   // printf("%x %x %x \n", byte1, byte2, byte3);
   unsigned int deltaX = abs((int)byte2);
   unsigned int deltaY = abs((int)byte3);

   // printf("%d %d\n", deltaX, deltaX * (1 - ((byte1&0x10)!=0)*2));
   // printf("%d %d\n", deltaY, deltaY * (1 - ((byte1&0x20)!=0)*2));

   mouse.position.x += deltaX * (1 - ((byte1 & 0x10) != 0) * 2);
   mouse.position.y -= deltaY * (1 - ((byte1 & 0x20) != 0) * 2);

   if (mouse.position.x >= WIDTH)
      mouse.position.x = WIDTH - 1;
   else if (mouse.position.x < 0)
      mouse.position.x = 0;

   if (mouse.position.y >= HEIGHT)
      mouse.position.y = HEIGHT - 1;
   else if (mouse.position.y < 0)
      mouse.position.y = 0;

   if ((byte1 & 0b1) != 0)
   {
      mouse.left = 1;
   }
   else if (mouse.left)
   {
      mouse.wasLeft = 1;
      mouse.left = 0;
   }

   if ((byte1 & 0b10) != 0)
      mouse.right = 1;

   if ((byte1 & 0b100) != 0)
      mouse.mid = 1;
   return processMouse();
}

